import React from 'react';
import './index.css';
import { Container } from 'react-bootstrap/Container';

class AboutPage extends React.Component{
    render() {
        return(
            <Container>
                <h1 className="mx-auto about-page-title">About</h1>
            </Container>
        );
    }
}

export default AboutPage;
